hich you want to use for users to submit the bookings'=>'Vælg dato, som du vil bruge til at bruge brugerne til at sende reservationerne','Booking Date'=>'Bookingdato','Only form without calendar'=>'Kun formular uden kalender','For example, a visitor can choose to book 7 or 14 days or 21 days starting on \'2027-02-15\'. To configure this, enter date in format \'YYYY-MM-DD\' such as \'2027-02-15\' and set the number of days to select as \'7,14,21\'. Click the \'Add Rule\' button.'=>'En besøgende kan f.eks. vælge at booke 7 eller 14 dage eller 21 dage fra \'2027-02-15\'. For at konfigurere dette skal du indtaste dato i formatet \'ÅÅÅÅ-MM-DD\', såsom \'2027-02-15\' og indstille antallet af dage, der skal vælges som \'7,14,21\'. Klik på knappen \'Tilføj regel\'.','Specify the number of days to select when starting the selection on a specific date.'=>'Angiv det antal dage, der skal vælges, når du starter markeringen på en bestemt dato.','For date'=>'Til dato','For example, a visitor can starting days selection only on \'Sunday\' or \'Friday\' if select days on \'Low season\'. To configure this, select the \'Low season\' option in the dropdown menu and enable \'Sunday\' and \'Friday\' boxes. Click the \'Add Rule\' button.'=>'En besøgende kan f.eks. kun vælge startdage på \'søndag\' eller \'fredag\', hvis der vælges dage i \'Lavsæson\'. For at konfigurere dette skal du vælge \'Lavsæson\' i rullemenuen og aktivere felterne \'Søndag\' og \'Fredag\'. Klik på knappen \'Tilføj regel\'.','Specify the weekdays as start days for selection when starting the selection in a specific season.'=>'Angiv ugedage som startdage for udvælgelse, når du starter udvælgelsen i en bestemt sæson.','allow to start days selection only for these weekdays'=>'tillad kun at vælge startdage for disse ugedage','For example, a visitor can choose to book any number from 7 to 14 days or 21 days starting on \'High season\', or any number from 2 to 5 days starting on \'Low season\', and so forth. To configure this, select the \'High season\' option in the dropdown menu and set the number of days to select as \'7-14,21\'. Click the \'Add Rule\' button. Next, select the \'Low season\' option in the dropdown menu and set the number of days to select as \'2-5\'. Click the \'Add Rule\' button again.'=>'For eksempel kan en besøgende vælge at booke et hvilket som helst antal fra 7 til 14 dage eller 21 dage fra \'Højsæson\' eller et hvilket som helst tal fra 2 til 5 dage fra \'Lavsæson\' og så videre. For at konfigurere dette skal du vælge \'Højsæson\' i rullemenuen og indstille antallet af dage, der skal vælges som \'7-14,21\'. Klik på knappen \'Tilføj regel\'. Vælg derefter indstillingen \'Lavsæson\' i rullemenuen og indstil antallet af dage, der skal vælges som \'2-5\'. Klik på knappen \'Tilføj regel\' igen.','Specify the number of days to select when starting the selection in a specific season.'=>'Angiv det antal dage, der skal vælges, når du starter valget i en bestemt sæson.','Add Rule'=>'Tilføj regel','allow to select'=>'tillad at vælge','Add new season'=>'Tilføj ny sæson','In season'=>'I sæsonen','Explore %1$sJavaScript customization%2$s for advanced different day selection in different calendars.'=>'Udforsk %1$sJavaScript-tilpasning%2$s for avanceret valg af forskellige dage i forskellige kalendere.','For example, a visitor can choose to book only 5 or 7 days starting on Monday, or any number from 2 to 7 days starting on Saturday, and so forth. To configure this, check the \'Monday\' box and set the number of days to select as \'5,7\'. Then, check the \'Saturday\' box and set the number of days to select as \'2-7\'. Finally, click the \'Set Rule\' button.'=>'For eksempel kan en besøgende vælge kun at booke 5 eller 7 dage fra mandag, eller et hvilket som helst antal fra 2 til 7 dage fra lørdag og så videre. For at konfigurere dette skal du markere afkrydsningsfeltet \'Mandag\' og indstille antallet af dage, der skal vælges som \'5,7\'. Marker derefter afkrydsningsfeltet \